import { useState, useEffect } from "react";
import { Link } from "react-router-dom";


function Channels()
{
    const [getList, setList] = useState([]);
    // To call geCommentst() everytime on load
    useEffect(() => {
        getChannels();
    });
    function getChannels()
    {
        fetch('http://localhost:8080/getChannels',
        {
            method: 'GET',
            // body: new URLSearchParams({
            //     postId: postId
            //     }),
            headers: {
                "Content-type": "application/x-www-form-urlencoded"
                }
        }
        ).then(response => response.json()).then(response => setList(response)).catch(error => console.error(error))
        // console.log(getList);
    }
    return(
        <div className="channelsListClass"  onClick={() => alert("Hello from here")}>
            {getList.map(channel => (
            <div>
                <p> {channel.name}</p>
            </div>
            ))}
            <Link to='/addChannel'>Add</Link>
        </div>
    )
};

export default Channels;
